import "./App.scss";
import Header from "./components/Header";
import TableUsers from "./components/TableUsers";
import Container from "react-bootstrap/Container";
import Button from "react-bootstrap/Button";

function App() {
  return (
    <div className="app-container">
      <Container>
        <Header />
        <div className="my-3">
          List Users:
          <Button variant="success mx-3">Add User</Button>
          {/* <button className="mx-3 btn btn-outline-success">Add User</button> */}
        </div>

        <TableUsers />
      </Container>
    </div>
  );
}

export default App;
